import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap:{
        padding: '20px',
        fontFamily: "SFUIDisplay-Light"
    },
    h:{
        fontSize: "30px",
    },
    t:{
        color: "#acacac",
        fontSize: "15px",
        lineHeight: "27px"
    },
    t1:{
        fontFamily: "SFUIDisplay-Bold",
        lineHeight: "30px",
        fontSize: "15px",
        fontWeight: 700,
    },
    t2:{
        fontSize: "15px",
        marginTop: "5px"
    }
});
export default styles;
